import { Component, ElementRef, HostListener, ViewChild } from '@angular/core';
import { Router } from '@angular/router';
import { LayoutService } from 'src/app/layout/service/app.layout.service';
import { TeamMember } from 'src/app/demo/api/teamMember';
import { Project } from 'src/app/demo/api/project';
import { MailSenderService } from 'src/app/demo/service/mail.service';
import { FormBuilder, FormGroup, Validators } from '@angular/forms';
import { AuthDialogService } from 'src/app/demo/service/auth-dialog.service';
@Component({
  selector: 'app-landing',
  templateUrl: './landing.component.html',
  styleUrls:['./landing.component.scss'],
})
export class LandingComponent {
  emailForm: FormGroup;
  @ViewChild('featuresSection') featuresSection: ElementRef;

  email: string = '';
  subject: string = '';
  message: string = '';
  isNavbarGray = false;
  isResponsiveMenuGray: boolean = false;
  animationState = {
    highlights: 'hide',
    features: 'hide',
    pricing:'hide',
    certif:'hide',
    // Add more section IDs as needed
  };

  images: string[] = [
    'assets/demo/images/landing/score.webp',
    'assets/demo/images/landing/sflow1.webp',
    'assets/demo/images/landing/sflow2.webp'
  ];
  Project :Project[] =
    // Example projects data
     [
        {
            image: 'assets/demo/images/landing/sflow1.webp',
            title: 'Winner Flow',
            description: 'Le Winner Flow est un embout d\'exsufflation utilisé lors d\'exercices respiratoires. Il assure un débit ventilatoire constant.',

        },
        {
            image: 'assets/demo/images/landing/sflow2.webp',
            title: 'STIM-Flow',
            description: 'Le STIMFLOW® est un stimulateur biofeedback abdomino-périnéal, associé au Winner Flow, permettant de rééduquer les pathologies de la statique pelvienne.',

        },
        {
            image: 'assets/demo/images/landing/score.webp',
            title: 'Scores',
            description: 'Scores est un dispositif médical software destiné aux professionnels de santé et aux patients pour le suivi et la gestion des soins médicaux.',

        },
        // Add more projects as needed
    ];
  teamMembers: TeamMember[] = [
    { name: 'John Doe', position: 'Developer', image: 'https://flowbite.s3.amazonaws.com/blocks/marketing-ui/avatars/jese-leos.png' },
    { name: 'Jane Smith', position: 'Designer', image: 'https://flowbite.s3.amazonaws.com/blocks/marketing-ui/avatars/jese-leos.png' },
    { name: 'Jane Smith', position: 'Designer', image: 'https://flowbite.s3.amazonaws.com/blocks/marketing-ui/avatars/jese-leos.png' },
    { name: 'Jane Smith', position: 'Designer', image: 'https://flowbite.s3.amazonaws.com/blocks/marketing-ui/avatars/jese-leos.png' },
    { name: 'Jane Smith', position: 'Designer', image: 'https://flowbite.s3.amazonaws.com/blocks/marketing-ui/avatars/jese-leos.png' },
  ];

  constructor(private authDialogService: AuthDialogService,private fb: FormBuilder,public layoutService: LayoutService, public router: Router,public el: ElementRef,private mailSenderService: MailSenderService) { 
    this.emailForm = this.fb.group({
      email: ['', [Validators.required, Validators.email]],
      subject: ['', Validators.required],
      message: ['', Validators.required]
    });
  }
  ngOnInit(): void {
    this.scrollToFeatures();
    this.onScroll();
  }

  scrollToFeatures(): void {
    if (this.featuresSection) {
      this.featuresSection.nativeElement.scrollIntoView({ behavior: 'smooth' });
    }
  }


  toggleNavbarColor() {
    this.isNavbarGray = true;
}
openAuthDialog() {
  this.authDialogService.openAuthDialog();
}
sendEmail() {
  if (this.emailForm.valid) {
    const mail = {
      email: this.emailForm.value.email,
      subject: this.emailForm.value.subject,
      message: this.emailForm.value.message
    };

    console.log('Mail data from Angular:', mail);

    this.mailSenderService.sendMail(mail).subscribe(
      response => {
        console.log('Email sent successfully:', response);
        this.emailForm.reset();
      },
      error => {
        console.error('Error sending email:', error);
        this.emailForm.reset();
      }
    );
  }
}


    @HostListener('window:scroll', ['$event'])
    onScroll() {
      this.isNavbarGray = window.scrollY > 100; // Adjust the scroll position threshold
      const sections = ['highlights', 'features','pricing','projets','certif']; // Add more section IDs as needed

      sections.forEach(section => {
        const offset = 100;
        const threshold = 0.3;

        const scrollPosition = window.scrollY;
        const windowHeight = window.innerHeight;
        const element = document.getElementById(section);

        if (element) {
          const elementPosition = element.offsetTop;
          const elementHeight = element.offsetHeight;

          const isVisible =
            scrollPosition + windowHeight > elementPosition + offset &&
            scrollPosition < elementPosition + elementHeight - offset;

          this.animationState[section] = isVisible ? 'show' : 'hide';
        }
      });
    }



  }
<div class="surface-0 flex justify-content-center">
    <div id="home" class="landing-wrapper overflow-hidden">
        <div class="navbar-container fixed top-0 left-0 w-full py-1 px-5 md:px-6 lg:px-8 flex items-center justify-between z-10"
        [ngClass]="{'bg-transparent': !isNavbarGray, 'bg-gray-200': isNavbarGray}">          <a class="flex align-items-center" href="#">
                <img src="../../../../../assets/demo/images/landing/Frame (2).png" alt="Sakai Logo" class="h-12 lg:h-15 mr-0 lg:mr-2 pl-2">
                <span class="text-900 font-medium text-2xl line-height-3 mr-8"></span>

                            </a>
                            <a pRipple class="cursor-pointer block lg:hidden text-700" pStyleClass="@next" enterClass="hidden" leaveToClass="hidden"
                            [hideOnOutsideClick]="true" (click)="toggleNavbarColor()">
                             <i class="pi pi-bars text-4xl"></i>
                         </a>

            <div class="align-items-center surface-0 flex-grow-1 justify-content-between hidden lg:flex absolute lg:static w-full left-0 px-6 lg:px-0 z-2 items" style="top:48px"[ngClass]="{'bg-transparent': !isNavbarGray, 'bg-gray-200': isNavbarGray} ">
                <ul class="list-none p-0 m-0 flex lg:align-items-center select-none flex-column lg:flex-row cursor-pointer   ">
                    <li>
                        <a onclick="location.href='#hero'" pRipple class="flex m-0 md:ml-5 px-0 py-3 text-900 font-medium line-height-3 text-xl text-blue-900" >
                            <span>Accueil </span>
                        </a>


                    </li>
                    <li>
                        <a onclick="location.href='#highlights'" pRipple class="flex m-0 md:ml-5 px-0 py-3 text-900 font-medium line-height-3 text-xl text-blue-900">
                            <span>À propos de nous</span>
                        </a>
                    </li>
                    <li>
                        <a onclick="location.href='#features'" pRipple class="flex m-0 md:ml-5 px-0 py-3 text-900 font-medium line-height-3 text-xl text-blue-900">
                            <span>Nos services </span>
                        </a>
                    </li>
                    <li>
                        <a onclick="location.href='#projets'" pRipple class="flex m-0 md:ml-5 px-0 py-3 text-900 font-medium line-height-3 text-xl text-blue-900">
                            <span>Nos projets </span>
                        </a>
                    </li>

                    <li>
                        <a onclick="location.href='#certif'" pRipple class="flex m-0 md:ml-5 px-0 py-3 text-900 font-medium line-height-3 text-xl text-blue-900">
                            <span>Nos certificats  </span>
                        </a>
                    </li> 

                    <li>
                        <a onclick="location.href='#contact'" pRipple class="flex m-0 md:ml-5 px-0 py-3 text-900 font-medium line-height-3 text-xl text-blue-900">
                            <span>Contact  </span>
                        </a>
                    </li>

                </ul>
                <div class="relative z-10" aria-labelledby="modal-title" role="dialog" aria-modal="true">
                    <!--
                      Background backdrop, show/hide based on modal state.

                      Entering: "ease-out duration-300"
                        From: "opacity-0"
                        To: "opacity-100"
                      Leaving: "ease-in duration-200"
                        From: "opacity-100"
                        To: "opacity-0"
                    -->
                    <div class="fixed inset-0 bg-gray-500 bg-opacity-75 transition-opacity"></div>

                    <div class="fixed inset-0 z-10 w-screen overflow-y-auto">
                      <div class="flex min-h-full items-end justify-center p-4 text-center sm:items-center sm:p-0">
                        <!--
                          Modal panel, show/hide based on modal state.

                          Entering: "ease-out duration-300"
                            From: "opacity-0 translate-y-4 sm:translate-y-0 sm:scale-95"
                            To: "opacity-100 translate-y-0 sm:scale-100"
                          Leaving: "ease-in duration-200"
                            From: "opacity-100 translate-y-0 sm:scale-100"
                            To: "opacity-0 translate-y-4 sm:translate-y-0 sm:scale-95"
                        -->
                        <div class="relative transform overflow-hidden rounded-lg bg-white text-left shadow-xl transition-all sm:my-8 sm:w-full sm:max-w-lg">
                          <div class="bg-white px-4 pb-4 pt-5 sm:p-6 sm:pb-4">
                            <div class="sm:flex sm:items-start">
                              <div class="mx-auto flex h-12 w-12 flex-shrink-0 items-center justify-center rounded-full bg-red-100 sm:mx-0 sm:h-10 sm:w-10">
                                <svg class="h-6 w-6 text-red-600" fill="none" viewBox="0 0 24 24" stroke-width="1.5" stroke="currentColor" aria-hidden="true">
                                  <path stroke-linecap="round" stroke-linejoin="round" d="M12 9v3.75m-9.303 3.376c-.866 1.5.217 3.374 1.948 3.374h14.71c1.73 0 2.813-1.874 1.948-3.374L13.949 3.378c-.866-1.5-3.032-1.5-3.898 0L2.697 16.126zM12 15.75h.007v.008H12v-.008z" />
                                </svg>
                              </div>
                              <div class="mt-3 text-center sm:ml-4 sm:mt-0 sm:text-left">
                                <h3 class="text-base font-semibold leading-6 text-gray-900" id="modal-title">Deactivate account</h3>
                                <div class="mt-2">
                                  <p class="text-sm text-gray-500">Are you sure you want to deactivate your account? All of your data will be permanently removed. This action cannot be undone.</p>
                                </div>
                              </div>
                            </div>
                          </div>
                          <div class="bg-gray-50 px-4 py-3 sm:flex sm:flex-row-reverse sm:px-6">
                            <button type="button" class="inline-flex w-full justify-center rounded-md bg-red-600 px-3 py-2 text-sm font-semibold text-white shadow-sm hover:bg-red-500 sm:ml-3 sm:w-auto">Deactivate</button>
                            <button type="button" class="mt-3 inline-flex w-full justify-center rounded-md bg-white px-3 py-2 text-sm font-semibold text-gray-900 shadow-sm ring-1 ring-inset ring-gray-300 hover:bg-gray-50 sm:mt-0 sm:w-auto">Cancel</button>
                          </div>
                        </div>
                      </div>
                    </div>
                  </div>

                <div class="flex justify-content-between lg:block border-top-1 lg:border-top-none surface-border py-3 lg:py-0 mt-3 lg:mt-0">
                    <!-- <button pButton pRipple label="Login" class="p-button-text p-button-rounded border-none font-light line-height-2 text-blue-500"></button> -->
                </div>
            </div>
        </div>
        <div id="hero" class="flex flex-column pt-4 px-4 lg:px-8 overflow-hidden relative animate-fade-in-down"
        style="background: url('../../../../../assets/demo/images/landing/Artboard 2-100 1 (1).png') 50% 100% / cover no-repeat; height: 100vh;">
        <div  style="position: absolute; top: 40%; left: 4%; transform: translateY(-50%);">
            <h1 class="text-gray-700 md:text-6xl lg:text-6xl " style="font-weight: bold; color: #333;">Bienvenue sur</h1>
            <h1 class="text-blue-900 md:text-8xl lg:text-9xl" style="font-weight: bold;">MED'INOUTLOOK</h1>
            <p style="font-size: 2rem; line-height: 2.5rem; color: #555;">Bureau d’étude de conception et développement  <br>
                des dispositifs médicaux</p>
            <button pButton pRipple type="button" onclick="location.href='#contact'" style="font-size: 1.5rem; background-color: #3498db; color: #fff; padding: 10px 20px; border: none;">Contactez-nous</button>
        </div>
    </div>


    <!-- Back to top button -->
    <app-scroll-to-top></app-scroll-to-top>


    <div id="highlights" class="py-8 px-4 lg:px-8 mx-0 my-6 lg:mx-8">
        <div class="text-center" >
            <h2 class="text-900 font-bold mb-2 text-6xl "  [ngClass]="{'animate-fade-in-down': animationState['highlights'] === 'show'}">À propos de nous</h2>
            <!-- <span class="text-600 text-2xl">Amet consectetur adipiscing elit...</span> -->
        </div>

        <div class="grid mt-8 pb-2 md:pb-8">
            <div [ngClass]="{'animate-fade-in-right': animationState['highlights'] === 'show'}"class="flex justify-content-center col-12 lg:col-6 p-0 flex-order-1 lg:flex-order-0" style="border-radius:8px;">
                <img   src="../../../../../assets/demo/images/landing/vb 1 (1).png" class="w-11 lg:h-5/6" alt="mockup mobile">
            </div>

            <div class="col-12 lg:col-6 my-auto flex flex-column lg:items-start text-left lg:text-left line-height-5">


                <div class="ml-0 md:ml-2 ">

                    <h2 class="line-height-1 text-900 text-4xl lg:text-3xl font-normal text-start pt-6">Notre vision</h2>
                    <span class="text-700 text-xl lg:text-1xl line-height-3" style="max-width: 650px;">La vision de Med'In outlook consiste a étre un leader international dans le domaine de conception et developpement des dispositifs médicaux</span>
                </div>

                <div class="ml-0 md:ml-2">
                    <h2 class="line-height-1 text-900 text-4xl lg:text-3xl  font-normal pt-6">Objectifs stratégiques</h2>
                    <span class="text-700 text-xl line-height-3" style="max-width: 650px;">Notre mission est de répondre efficacement aux besoins et aux attentes actuels et futurs des partenaires de notre bureau d'études, de recherche et développement, dans le domaine de conception et le développement de dispositifs médicaux.</span>
                </div>

                <div class="ml-0 md:ml-2">
                    <h2 class="line-height-1 text-900 text-4xl lg:text-3xl  font-normal pt-6">Notre mission</h2>
                    <span class="text-700 text-xl line-height-3" style="max-width: 650px;">
                        <li>Assurer la disponiblité des ressources nécessaires afin de satisfaire les exigences de nos clients et  les exigences réglementaires applicables</li>
                        <li>Renforcer d'une façon continue la compétence de notre personnel </li>
                        <li>Assurer l'amelioration continue au sein de notre organisme </li>
                        <li>Assurer une bonne communication en interne  comme en externe</li>
                    </span>
                </div>
            </div>



        </div>



    </div>






    <div id="features" #featuresSection  class="py-8 px-4 lg:px-8 mt-5 mb-8 mx-0 "  style="background-color: #f6f6f6;" [ngClass]="{'animate-fade-in-down': animationState['features'] === 'show'}" >
